contracts/import/testLibrary.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.4.24;

import "./library.sol";

contract TestLibrary {
    using IntExtended for uint;

    function testIncrement(uint _base) view returns (uint){
        return _base.increament();
    }


    function testDecrement(uint _base) view returns (uint){
        return _base.decrement();
    }

    function testIncrementByValue(uint _base, uint value) view returns (uint){
        return _base.decrementByValue(value);
    }

    function testDecrementByValue(uint _base,uint value) view returns (uint){
        return _base.incrementByValue(value);
    }

}

contracts/import/library.sol.content:
pragma solidity 0.4.24;


library IntExtended{
    function increament(uint _self) returns (uint){
        return _self+1;
    }

    function decrement(uint _self) returns (uint){
        return _self-1;
    }

    function incrementByValue(uint _self,uint value) returns (uint){
        return _self+value;
    }
     function decrementByValue(uint _self,uint value) returns (uint){
        return _self-value;
    }
}

